			<p>941223 FT  23 DEC 94 / Two Palestinians killed in occupied territories Two Palestinians were killed and two wounded yesterday in incidents in Jericho, Gaza and the occupied West Bank which threw a shadow over continuing attempts to advance the Israeli-Palestinian peace process.</p>
